import React from 'react';
import Link from 'next/link';
import Header from './header'

const layaout = (props) => {
    return (
        <>
            <h1>Header prro</h1>
            <Header/>
            <main>
                {props.children}
            </main>
        </>
    );
};

export default layaout;
